$.validator.setDefaults({highlight:function(n,t,i){n.type==="radio"?this.findByName(n.name).addClass(t).removeClass(i):($(n).addClass(t).removeClass(i),$(n).closest(".form-group").addClass("has-error"))},unhighlight:function(n,t,i){n.type==="radio"?this.findByName(n.name).removeClass(t).addClass(i):($(n).removeClass(t).addClass(i),$(n).closest(".form-group").removeClass("has-error"))}});$.validator.addMethod("greaterthanzero",function(n){return n>0});$.validator.unobtrusive.adapters.add("greaterthanzero",function(n){n.rules.greaterthanzero=!0;n.messages.greaterthanzero=n.message});$.validator.addMethod("notgreaterthan",function(n,t,i){return+n<=+$(i).val()});$.validator.unobtrusive.adapters.add("notgreaterthan",["otherpropertyname","prefix"],function(n){n.rules.notgreaterthan="#"+n.params.prefix+n.params.otherpropertyname;n.messages.notgreaterthan=n.message});